import React from 'react';
import './App.css';
import Header from './components/Header';
import MainSection from './components/MainSection';
import Notification from './components/Notification';
import SideSection from './components/SideSection';

function App() {
  return (
    <div>
      <Header />
      <Notification topic = '' />
      <Notification />
      <Notification />
      <MainSection />
      <SideSection />
    </div>
  );
}

export default App;
